(1,1,'2025-10-07 15:35:49','2025-10-07 13:35:49','<!-- wp:paragraph -->\n<p>Bienvenue sur WordPress. Ceci est votre premier article. Modifiez-le ou supprimez-le, puis commencez  crire!</p>\n<!-- /wp:paragraph -->','Bonjour tout le monde!','','publish','open','open','','bonjour-tout-le-monde','','','2025-10-07 15:35:49','2025-10-07 13:35:49','',0,'http://10.1.8.250/?p=1',0,'post','',1),
(2,1,'2025-10-07 15:35:49','2025-10-07 13:35:49','<!-- wp:paragraph -->\n<p>Bienvenue chez <strong>DripLab</strong>, lendroit o la passion pour le code rencontre lart du style.</p>\n<!-- /wp:paragraph --><!-- wp:quote -->\n<blockquote><!-- wp:paragraph -->\n<p><strong>DripLab</strong> est n de la rencontre entre passion pour le code et amour du style. Chaque projet et chaque cration reflte ce mlange unique : des lignes de code prcises et des choix vestimentaires audacieux.</p>\n<!-- /wp:paragraph --><!-- wp:paragraph -->\n<p>Notre mission est simple : offrir des expriences et des produits qui allient <strong>technologie et esthtique</strong>, pour que chaque client se sente unique et inspir. Chez DripLab, le code devient signature et le style, identit.</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote --><!-- wp:paragraph -->\n<p>Chez DripLab, le code devient signature et le style, identit. Plus quune marque, DripLap est un univers o crativit, technologie et style sentrelacent pour crer quelque chose de vritablement original.</p>\n<!-- /wp:paragraph -->													<img width=\"768\" height=\"1024\" src=\"http://10.1.219.150/wp-content/uploads/2025/10/maneken-11AU096.jpg\" alt=\"\" srcset=\"http://10.1.219.150/wp-content/uploads/2025/10/maneken-11AU096.jpg 768w, http://10.1.219.150/wp-content/uploads/2025/10/maneken-11AU096-225x300.jpg 225w, http://10.1.219.150/wp-content/uploads/2025/10/maneken-11AU096-600x800.jpg 600w\" sizes=\"(max-width: 768px) 100vw, 768px\" />','Notre Histoire','','publish','closed','open','','page-d-exemple','','','2025-10-09 12:02:48','2025-10-09 10:02:48','',0,'http://10.1.8.250/?page_id=2',0,'page','',0),
(3,1,'2025-10-07 15:35:49','2025-10-07 13:35:49','<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Qui sommes-nous?</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texte suggr: </strong>Ladresse de notre site est: http://10.1.8.250.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Commentaires</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texte suggr: </strong>Quand vous laissez un commentaire sur notre site, les donnes inscrites dans le formulaire de commentaire, ainsi que votre adresse IP et lagent utilisateur de votre navigateur sont collects pour nous aider  la dtection des commentaires indsirables.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Une chane anonymise cre  partir de votre adresse e-mail (galement appele hash) peut tre envoye au service Gravatar pour vrifier si vous utilisez ce dernier. Les clauses de confidentialit du service Gravatar sont disponibles ici: https://automattic.com/privacy/. Aprs validation de votre commentaire, votre photo de profil sera visible publiquement  cot de votre commentaire.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Mdias</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texte suggr: </strong>Si vous tlversez des images sur le site, nous vous conseillons dviter de tlverser des images contenant des donnes EXIF de coordonnes GPS. Les personnes visitant votre site peuvent tlcharger et extraire des donnes de localisation depuis ces images.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Cookies</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texte suggr: </strong>Si vous dposez un commentaire sur notre site, il vous sera propos denregistrer votre nom, adresse e-mail et site dans des cookies. Cest uniquement pour votre confort afin de ne pas avoir  saisir ces informations si vous dposez un autre commentaire plus tard. Ces cookies expirent au bout dun an.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Si vous vous rendez sur la page de connexion, un cookie temporaire sera cr afin de dterminer si votre navigateur accepte les cookies. Il ne contient pas de donnes personnelles et sera supprim automatiquement  la fermeture de votre navigateur.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Lorsque vous vous connecterez, nous mettrons en place un certain nombre de cookies pour enregistrer vos informations de connexion et vos prfrences dcran. La dure de vie dun cookie de connexion est de deux jours, celle dun cookie doption dcran est dun an. Si vous cochez Se souvenir de moi, votre cookie de connexion sera conserv pendant deux semaines. Si vous vous dconnectez de votre compte, le cookie de connexion sera effac.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>En modifiant ou en publiant une publication, un cookie supplmentaire sera enregistr dans votre navigateur. Ce cookie ne comprend aucune donne personnelle. Il indique simplement lID de la publication que vous venez de modifier. Il expire au bout dun jour.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Contenu embarqu depuis dautres sites</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texte suggr: </strong>Les articles de ce site peuvent inclure des contenus intgrs (par exemple des vidos, images, articles). Le contenu intgr depuis dautres sites se comporte de la mme manire que si le visiteur se rendait sur cet autre site.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Ces sites web pourraient collecter des donnes sur vous, utiliser des cookies, embarquer des outils de suivis tiers, suivre vos interactions avec ces contenus embarqus si vous disposez dun compte connect sur leur site web.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Utilisation et transmission de vos donnes personnelles</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texte suggr: </strong>Si vous demandez une rinitialisation de votre mot de passe, votre adresse IP sera incluse dans le-mail de rinitialisation.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Dures de stockage de vos donnes</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texte suggr: </strong>Si vous laissez un commentaire, le commentaire et ses mtadonnes sont conservs indfiniment. Cela permet de reconnatre et approuver automatiquement les commentaires suivants au lieu de les laisser dans la file de modration.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Pour les comptes qui sinscrivent sur notre site (le cas chant), nous stockons galement les donnes personnelles indiques dans leur profil. Tous les comptes peuvent voir, modifier ou supprimer leurs informations personnelles  tout moment ( lexception de leur identifiant). Les gestionnaires du site peuvent aussi voir et modifier ces informations.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Les droits que vous avez sur vos donnes</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texte suggr: </strong>Si vous avez un compte ou si vous avez laiss des commentaires sur le site, vous pouvez demander  recevoir un fichier contenant toutes les donnes personnelles que nous possdons  votre sujet, incluant celles que vous nous avez fournies. Vous pouvez galement demander la suppression des donnes personnelles vous concernant. Cela ne prend pas en compte les donnes stockes  des fins administratives, lgales ou pour des raisons de scurit.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">O vos donnes sont envoyes</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texte suggr: </strong>Les commentaires des visiteurs peuvent tre vrifis  laide dun service automatis de dtection des commentaires indsirables.</p>\n<!-- /wp:paragraph -->\n','Politique de confidentialit','','draft','closed','open','','politique-de-confidentialite','','','2025-10-07 15:35:49','2025-10-07 13:35:49','',0,'http://10.1.8.250/?page_id=3',0,'page','',0),
