(155,1,'2025-10-08 11:22:38','2025-10-08 09:22:38','/* --- Carte produit moderne --- */\r\n.woocommerce ul.products li.product {\r\n  padding: 20px;\r\n  background: #fff;\r\n  border-radius: 16px;\r\n  box-shadow: 0 4px 15px rgba(0,0,0,0.08);\r\n  transition: transform 0.3s ease, box-shadow 0.3s ease;\r\n  text-align: center;\r\n}\r\n\r\n/* Effet hover sur la carte */\r\n.woocommerce ul.products li.product:hover {\r\n  transform: translateY(-5px);\r\n  box-shadow: 0 6px 20px rgba(0,0,0,0.12);\r\n}\r\n\r\n/* Titre du produit */\r\n.woocommerce ul.products li.product .woocommerce-loop-product__title {\r\n  font-size: 18px;\r\n  font-weight: 600;\r\n  margin: 10px 0;\r\n  color: #222222; /* couleur du titre */\r\n}\r\n\r\n/* Prix en noir */\r\n.woocommerce ul.products li.product .price {\r\n  font-weight: 700;\r\n  color: #000000; /* prix en noir */\r\n  margin-bottom: 10px;\r\n}\r\n\r\n/* Bouton Ajouter au panier noir */\r\n.woocommerce ul.products li.product .button {\r\n  background-color: #000000; /* noir */\r\n  color: #ffffff; /* texte blanc */\r\n  padding: 10px 20px;\r\n  border-radius: 8px;\r\n  transition: background 0.3s;\r\n}\r\n\r\n/* Hover bouton */\r\n.woocommerce ul.products li.product .button:hover {\r\n  background-color: #333333; /* gris fonc au hover */\r\n}\r\n\r\n/* Cacher les toiles sur les pages produits et boutique */\r\n.woocommerce div.product .woocommerce-product-rating,\r\n.woocommerce ul.products li.product .star-rating {\r\n    display: none !important;\r\n}\r\n\r\n','CSS for my product','','publish','closed','closed','','155','','','2025-10-08 11:28:36','2025-10-08 09:28:36','',0,'http://10.1.8.250/?post_type=custom-css-js&#038;p=155',0,'custom-css-js','',0),
(157,1,'2025-10-08 12:09:41','2025-10-08 10:09:41','<!-- wp:paragraph -->\n<p>Bienvenue chez <strong>DripLab</strong>, lendroit o la passion pour le code rencontre lart du style.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p><strong>DripLa</strong>b est n de la rencontre entre passion pour le code et amour du style. Chaque projet et chaque cration reflte ce mlange unique : des lignes de code prcises et des choix vestimentaires audacieux.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Notre mission est simple : offrir des expriences et des produits qui allient <strong>technologie et esthtique</strong>, pour que chaque client se sente unique et inspir. Chez DripLab, le code devient signature et le style, identit.</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Chez DripLab, le code devient signature et le style, identit. Plus quune marque, DripLap est un univers o crativit, technologie et style sentrelacent pour crer quelque chose de vritablement original.</p>\n<!-- /wp:paragraph -->','DripLab','','inherit','closed','closed','','2-revision-v1','','','2025-10-08 12:09:41','2025-10-08 10:09:41','',2,'http://10.1.8.250/?p=157',0,'revision','',0),
